import React, { useState } from "react";
import { render } from "react-dom";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";

const CompoundInterest = () => {
  return (
  <>
    <form>
    <TextField label="Standard" variant="outlined" />
    <TextField label="Filled" variant="filled" />
    <TextField label="Outlined" variant="outlined" /> 
    </form>
  </>
  );
};

const CompoundInterest2 = () => {
  return (
  <>
    <form>
    <TextField label="Standard" variant="outlined" />
    <TextField label="Filled" variant="filled" />
    <TextField label="Outlined" variant="outlined" /> 
    </form>
  </>
  );
};

const CompoundInterest3 = () => {
  return (
  <>
    <form>
    <TextField label="Standard" variant="outlined" />
    <TextField label="Filled" variant="filled" />
    <TextField label="Outlined" variant="outlined" /> 
    </form>
  </>
  );
};

render(<CompoundInterest />, document.querySelector("#root"));

render(<CompoundInterest2 />, document.querySelector("#root2"));

render(<CompoundInterest3 />, document.querySelector("#root3"));
